  const iRunOnluOnce = () => {
    console.log("i run only once");
  };
  useEffect(() => {
    console.log("call the api..");
  }, []);
  return (
    <div className="App">
      <h1 className={styles.title}>{counter}</h1>
      <button onClick={onClick}> click me </button>
    </div>
  );
}

export default App;
